import React from 'react';

const index = () => {
  const [contar, setContar] = React.useState(0);

  return (
    <div>
      <h1>Hello World</h1>
      <button onClick={() => setContar(contar + 1)}>Adicionar {contar}</button>
    </div>
  );
};

export default index;
